Mercedes-Benz E 200d Avantgarde

Автомобиль из Германии. Отличное состояние технически и визуально. Оригинальный пробег. Модель 2021 года.

 ⁃ пневмоподвеска;
 ⁃ контроль слепых зон;
 ⁃ контроль движения по полосам;
 ⁃ система Start-Stop;
 ⁃ DYNAMIC SELECT (Sport,Comfort, Economy);
 ⁃ система распознавания дорожных знаков;
 ⁃ проекция на лобовое стекло;
 ⁃ адаптивный круиз контроль Distronic plus с функцией торможения;
 ⁃ система помощи при парковке + камеры кругового обзора 360°;
 ⁃ рулевое колесо "люкс";
 ⁃ контурная подсветка салона Ambient;
 ⁃ подогрев сидений с памятью и руля;
 ⁃ заводская тонировка стёкл AS3;
 ⁃ 2 ключа;
 ⁃ беспроводная зарядка, 2 USB, USB Type C, интеграция смартфона через CarPlay или Google Automotive Link и многое другое.

